import './App.css';
import React, { useState } from 'react';
import Form from './components/Form';
import TodoList from './components/TodoList';

function App() {
  const[todos, setTodos] = useState([]);


  return (
    <div className="App">
      <Form todos={todos} setTodos={setTodos} />
      <TodoList />
    </div>
  );
}

export default App;
